        <div class="bg-white" id="page3">
          <div class="tit tit-line">
            <div></div>
             <img src="../assets/tit6.png" alt="">
            <div></div>
          </div>
          <div class="three-tab w1000">
            <div>
              <div class="f20">DECENTRALISED GOVERNANCE</div>
              <div class="f14">The design and implementation of the protocol would be determined by token holders. For parameters like pool staking fees, transaction fee burn, liquidity mining ratio, are initially set by the protocol itself; token holders could update the numbers and the smart contract itself based on the voting process. In order to encourage users to participate in the process, there could be some profit set to reward the voting participants.</div>
            </div>
            <div>
              <div class="f20">USER INCENTIVE</div>
              <div class="f14">A large proportion of the Konomi tokens are reserved to encourage users to add liquidity to the platform and to use the products. By depositing assets to the protocol, users could automatically market make for the protocol.</div>
            </div>
            <div>
              <div class="f20">ASSET STAKING</div>
              <div class="f14">Konomi token could be staked to participate in the base layer consensus and earn system rewards. It is also the staking currency to share platform revenue and ensure that the debt positions are safe.</div>
            </div>
          </div>
